import React from "react";
import "../styles/dashboard.css"
import {Link} from "react-router-dom";

function DashboardNavBar(props){
    return(
        <div id="dash-navbar">
            <div className="dash-navbar-item-containers"><button onClick={ () => {props.sidebarCollapse(e)} } id="hamburger-button" className="dashboard-navbar-buttons">&#9776;</button></div>
            <div className="dash-navbar-item-containers"><img id="dash-logo" src="./images/virtual-version-log.png"></img></div>
            <div className="dash-navbar-item-containers"><Link to="/file"><button className="dashboard-navbar-buttons">New File</button></Link></div>
        </div>
    );
}

export default DashboardNavBar;
